//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract NFTToken721 is ERC721Enumerable, Ownable{
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;
    address beneficiary;
    //logoURI
    string public logoURI;
    //featured URI
    string public featuredURI;
    //banner URI
    string public bannerURI;
    //name
    string public collectionName;
    //URI
    string public customURI;
    //links
    mapping(string=>string) public links;
    //treasuary fee
    uint256 public treasuaryFee;

    uint256 public MINT_PRICE = 0.01 ether;
    //token creators
    mapping(uint256=>address) public _creators;
    //token Uri    
    mapping(uint256=>string) private _tokenUri;
    //token name
    mapping(uint256=>string) public _tokenName;
    //external link
    mapping(uint256=>string) public _externalLink;
    //description
    mapping(uint256=>string) public _description;
    //properties
    mapping(uint256=>string[]) public _propertyNames;
    mapping(uint256=>mapping(string=>string)) public _propertyMapping;
    //types 0:art, 1:gameitem
    mapping(uint256=>uint8) public _kind;

    event minting(uint256 id, address indexed creator, string indexed tokenUri, string indexed tokenName, string externalLink, string description);
    event mintingGameItem(uint256 id, address indexed creator, string indexed tokenUri, string indexed tokenName, string externalLink, string description, string[] propertyNames, string[] propertyValues);

    constructor(string memory _logoURI, string memory _featuredURI, string memory _bannerURI, string memory _collectionName, string memory _customURI) ERC721("NFTToken", "NFTToken") {
        logoURI = _logoURI;
        featuredURI = _featuredURI;
        bannerURI = _bannerURI;
        collectionName = _collectionName;
        customURI = _customURI;
        beneficiary = msg.sender;
    }

    function updateLogoURI(string calldata _logoURI) public onlyOwner
    {
        logoURI = _logoURI;
    }

    function updateFeaturedURI(string calldata _featuredURI) public onlyOwner
    {
        featuredURI = _featuredURI;
    }

    function updateBannerURI(string calldata _bannerURI) public onlyOwner
    {
        bannerURI = _bannerURI;
    }

    function updateCollectionName(string calldata _collectionName) public onlyOwner
    {
        collectionName = _collectionName;
    }

    function updateCustomURI(string calldata _customURI) public onlyOwner
    {
        customURI = _customURI;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        return _tokenUri[tokenId];
    }

    function tokensOfOwner(address _owner) external view returns(uint256[] memory ) {
        uint256 tokenCount = balanceOf(_owner);
        if (tokenCount == 0) {
            // Return an empty array
            return new uint256[](0);
        } else {
            uint256[] memory result = new uint256[](tokenCount);
            uint256 index;
            for (index = 0; index < tokenCount; index++) {
                result[index] = tokenOfOwnerByIndex(_owner, index);
            }
            return result;
        }
    }

    function mint(string calldata tokenUri) public returns (uint256){
        _tokenIds.increment();
        uint256 newCharacter = _tokenIds.current();

        _mint(msg.sender, newCharacter);
        _tokenUri[newCharacter] = tokenUri;
        _kind[newCharacter] = 0;
        _creators[newCharacter] = msg.sender;
        emit minting(newCharacter, msg.sender, tokenUri, "", "", "");

        return newCharacter;
    }

    function mint_art(string calldata tokenUri,string calldata tokenName, string calldata externalLink, string calldata description) public returns (uint256){
        _tokenIds.increment();
        uint256 newCharacter = _tokenIds.current();

        _mint(msg.sender, newCharacter);
        _tokenUri[newCharacter] = tokenUri;
        _tokenName[newCharacter] = tokenName;
        _externalLink[newCharacter] = externalLink;
        _description[newCharacter] = description;
        _kind[newCharacter] = 0;
        _creators[newCharacter] = msg.sender;
        emit minting(newCharacter, msg.sender, tokenUri, tokenName, externalLink, description);

        return newCharacter;
    }

    function mint_item(string calldata tokenUri,string calldata tokenName, string calldata externalLink, string calldata description, string[] calldata propertyNames, string[] calldata propertyValues) public payable returns(uint256)  {
        require(msg.value >= MINT_PRICE, "not enough");
        _tokenIds.increment();
        uint256 newCharacter = _tokenIds.current();

        _mint(msg.sender, newCharacter);
        _tokenUri[newCharacter] = tokenUri;
        _tokenName[newCharacter] = tokenName;
        _externalLink[newCharacter] = externalLink;
        _description[newCharacter] = description;
        _creators[newCharacter] = msg.sender;
        _kind[newCharacter] = 1;
        for(uint256 i = 0; i < propertyNames.length; i++)
        {
            _propertyNames[newCharacter].push(propertyNames[i]);
            _propertyMapping[newCharacter][propertyNames[i]] = propertyValues[i];
        }
        emit mintingGameItem(newCharacter, msg.sender, tokenUri, tokenName, externalLink, description, propertyNames, propertyValues);

        return newCharacter;
    }

    function updateProperty(uint256 tokenId, string calldata key, string calldata value) public onlyOwner {
        _propertyMapping[tokenId][key] = value;
    }

    function withdraw_all() public onlyOwner{
        payable(beneficiary).transfer(address(this).balance);
    }

    function updateBeneficiary(address _newBeneficiary) external onlyOwner{
        require(beneficiary != _newBeneficiary,"The same address as the old one.");
        beneficiary = _newBeneficiary;
    }

    function updateMintPrice(uint256 mintPrice) external onlyOwner{
        MINT_PRICE = mintPrice;
    }
}

